import { makeStyles, createStyles, Theme } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import React from 'react'
import { Button, Card, CardActions, CardContent, CardMedia, ListItem, Typography } from '@material-ui/core';

interface ProjectProps {
    name: string
    description: string
    link: string
}

const useStyles = makeStyles((theme: Theme) =>
    createStyles({
        root: {

            display: 'flex',
        },
        details: {
            display: 'flex',
            flexDirection: 'column',
        },
        card: {
            backgroundColor: 'transparent'
        },
        content: {
            flex: "1 0 auto"
        },
        image: {
            height: 300,
            maxWidth: 300
        }
    }),
);

export default function PortfolioProject(props: ProjectProps) {
    const classes = useStyles()

    return (
        <Card className={classes.root}>
            <div className={classes.details}>
                <CardContent className={classes.content}>
                    <Typography component="h5" variant="h5">
                        Live From Space
              </Typography>
                </CardContent>
            </div>
            <CardMedia
                className={classes.cover}
                image="https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fwww.isothermal.edu%2Facademics%2Fhealth-public-services%2Fblet%2Fblet-05.jpg&f=1&nofb=1"
                title="Live from space album cover"
            />
        </Card>
    );
}
